{
  (mkTbLayerEval_instance->reset_RST_N)(asserted ? (tUInt8)0u : (tUInt8)1u);
}
void * MODEL_mkTbLayerEval::get_instance()
{
  return mkTbLayerEval_instance;
}

/* Fill in version numbers */
